import React, { Component } from 'react';
import FaleMais from './FaleMais';

class Planos extends Component {

  renderList = () => this.props.planos.map(planos => {
    //console.log(planos);
    return (
     <Plano  planos={planos} />
     );
  });

  render() {
    return (
      <div className="Planos">
      {this.props.planos && this.renderList()}
      </div>
    );
  }
}

export default Planos;
